  const time = stickersDataIndex.time.split(':');
  return(
    <div>
      <span>Окончание через:</span>
      <div>
        <div>
          <span>{time[0]}</span>
          <span>Час</span>
        </div>
        <div>
          <span>{time[0]}</span>
          <span>Мин</span>
        </div>
        <div>
          <span>{time[0]}</span>
          <span>Час</span>
        </div>
      </div>
    </div>

  )
}

export default Time
